import React from 'react';
import ReactDOM from 'react-dom';
import mobilePic from './images/Untitled.png';
const first = (
  <h1>SUBSCRIBE</h1>
)

const firstNameVal = 'First name'
const lastNameVal = 'Last name'
const emailVal = 'Email'
const headerStyle= {
  backgroundColor: '#61DBFB',
  fontFamily: 'Helvetica Neue',
  padding: 25,
  lineHeight: 1.5,
  borderRadius: '10px 10px 10px 10px'
}

const h1Style= {
  textAlign: 'center'
}

const header = (
  <header style={headerStyle}>
    <div style={h1Style}>
      {first}
    </div>
    <p style={h1Style}>Sign up with yours email address to receive news and updates</p>
    <div style={h1Style}>
      <input style={{ borderRadius: '10px 10px 10px 10px'}} type='text' placeholder={firstNameVal}></input>
      <input style={{ borderRadius: '10px 10px 10px 10px'}} type='text' placeholder={lastNameVal}></input>
      <input style={{ borderRadius: '10px 10px 10px 10px'}} type='text' placeholder={emailVal}></input>
    </div>
    <div style={h1Style}>
      <button style={{ backgroundColor:'red', borderRadius: '10px 10px 10px 10px'}} type='submit'>Subscribe</button>
    </div>

  </header>
)
const show = document.getElementById('root')

ReactDOM.render(
  header, show
);
